<script>
    // Assuming the map object is already initialized in the existing code as 'map'

    // Example GeoJSON layer
    var geojsonLayer = L.geoJSON(yourGeoJSONData).addTo(map);

    // Toggle control for layers
    var overlayMaps = {
        "GeoJSON Layer": geojsonLayer
    };

    L.control.layers(null, overlayMaps).addTo(map);

    // Add a function to toggle the visibility of the GeoJSON layer
    function toggleGeoJSONLayer() {
        if (map.hasLayer(geojsonLayer)) {
            map.removeLayer(geojsonLayer);
        } else {
            map.addLayer(geojsonLayer);
        }
    }
</script>


<script>
    // Load the GeoJSON file from assets/tracks/watchtower.geojson
    var geojsonLayer = L.geoJSON(null, {
        style: function (feature) {
            return { color: 'blue', weight: 4 };  // Customize track appearance
        },
        onEachFeature: function (feature, layer) {
            // Popup showing metadata
            if (feature.properties) {
                layer.bindPopup("<b>Track Date:</b> " + feature.properties.date + "<br>" +
                                "<b>Mileage:</b> " + feature.properties.mileage + "<br>" +
                                "<b>Elevation Gain:</b> " + feature.properties.elevation_gain + "<br>" +
                                "<b>Time Taken:</b> " + feature.properties.time);
            }
        }
    });

    // Fetch the GeoJSON from the assets folder
    fetch('assets/tracks/watchtower.geojson')
        .then(function (response) {
            return response.json();
        })
        .then(function (data) {
            geojsonLayer.addData(data);  // Add the loaded data to the map
        })
        .catch(function (error) {
            console.error('Error loading GeoJSON data:', error);
        });

    // Toggle control for layers (existing pins and GeoJSON)
    var overlayMaps = {
        "GeoJSON Layer": geojsonLayer
    };

    L.control.layers(null, overlayMaps).addTo(map);
</script>


<script>
    // Marker cluster for existing markers
    var marker_cluster = L.markerClusterGroup();

    // Add existing markers from the original map
    var marker_1 = L.marker([42.07673, -113.7137]).bindPopup("<b>Date:</b> 2020-10-18<br><b>Route:</b> Firewater<br><b>Rating:</b> 5.11b");

    marker_cluster.addLayer(marker_2);

    var marker_3 = L.marker([36.26892, -115.66803]).bindPopup("<b>Date:</b> 2023-05-28<br><b>Route:</b> Today, We are Thursday!<br><b>Rating:</b> 5.11b");
    marker_cluster.addLayer(marker_3);

    // Add the marker cluster to the map
    marker_cluster.addTo(map);

    // Add layer control to toggle between markers and tracks
    var overlayMaps = {
        "Pins": marker_cluster,
        "Tracks": geojsonLayer
    };

    L.control.layers(null, overlayMaps, {collapsed: false}).addTo(map);
</script>
